Cesto: 
🔸70 g práškového cukru
🔸170 g polohrubej múky
🔸1 vajce
🔸70 g masla
🔸1 lyžička kypriaceho prášku
Plnka:
🔸250 g mäkkého tvarohu
🔸60 g práškového cukru
🔸250 ml mlieka
🔸50 ml oleja
🔸2 vajíčka
🔸30 g zlatého klasu
Postup:
🔹Všetky suroviny na cesto si dáme do misky a rukou spracujeme cesto. 🔹Hotovým cestom vystelieme spodok a jemne aj boky okrúhlej formy. ( Ak by sa Vám veľmi lepilo, dajte ho na 30min do chladničky).
🔹Vystlanú formu cestom dáme na 5 minút zapiecť do rúry vyhriatej na 180°C. 
🔹V miske zatiaľ všetky suroviny na plnku spolu vymixujeme.
🔹Vyberieme formu a vylejeme na ňu plnku ( plnka je redšej konzistencie).
🔹Pečieme na 180°C cca 30-40 minút.
Hotový je vtedy, keď pekne okraje zhnednú a stred na pohľad vyzerá upečený (netrasie sa). 
🔹Vyberieme z rúry a necháme vychladnúť. Dĺžka pečenia môže byť rôzna v závislosti od veľkosti formy a rúry. Ak by moc hnedol okraj znížte teplotu a ešte nechajte piecť.
🔹Vrch som potrela džemom a poliala bielou čokoládou.
. . . . . .
💕Skvelo sa k tomu hodí ovocná omáčka: rozvaríte mrazené ovocie, pocukrujete, rozmixujete tyčovým mixérom a prepasírujete cez sitko. 
Podávať ju môžete ešte teplú.😋
. . . . . .
Želám dobrú chuť ak si ho skúsite určite neolutujete 😊😋❤💜.
